        return (
            <main>
                <form onSubmit={this.handleSubmit}>
                    <input placeholder="First Name" /> <br />
                    <input placeholder="Last Name" /> <br />
                    <input placeholder="Age" /> <br />

                    <input
                        type="radio"
                        name="gener"
                        checked={this.state.isFriendly}
                        onChange={this.handleChange}
                    />

                    <button>Submit</button>
                </form>
            </main>
        )
    }

}

export default App
